import React from "react";
import Card from "./Card";

const Service = () => {
  return (
    <>
      <div className="my-5">
        <h1 className="text-center">Our Services</h1>
      </div>
      <div className="container-fluid mb-5">
        <div className="row">
          <div className="col-10 mx-auto">
            <div className="row gy-4">
              <Card title='React JS' text='This is text 1' btn='Checkout' />
              <Card title='Bootstrap 5' text='This is text 2' btn='Checkout' />
              <Card title='HTML5' text='This is text 3' btn='Checkout' />
              <Card title='CSS3' text='This is text 4' btn='Checkout' />
              <Card title='Title 5' text='This is text 5' btn='Checkout' />
              <Card title='Title 6' text='This is text 6' btn='Checkout' />
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default Service;
